import React from "react";
import ExpenseItem from "./ExpenseItem";
import "./ExpensesList.css"

const ExpensesList = (props) => {
    let expensesContent = <p>No expense found</p>
    if (props.items.length > 0) {
        expensesContent = props.items.map(item => <ExpenseItem key={item.id} date={item.date} title={item.title} amount={item.amount} />)
    }
    return <ul className="expenses-list">{props.items.map(item => <ExpenseItem key={item.id} date={item.date} title={item.title} amount={item.amount} />)}</ul>;
};

export default ExpensesList;
